-- Table structure for table `ad_plan_account_log`
--

DROP TABLE IF EXISTS `ad_plan_account_log`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ad_plan_account_log` (
  `log_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '日志ID，主键，自增；',
  `log_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '日志记录时间戳；',
  `plan_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '日志关联推广计划ID；',
  `plan_state` varchar(24) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '推广计划当前状态；',
  `charge_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '交易类型：0,cpm; 1,cpt;',
  `start_date` date NOT NULL COMMENT '推广开始日期；',
  `end_date` date NOT NULL COMMENT '推广截止日期；',
  `account_date` date NOT NULL COMMENT '账期，即账单流水生成日期；',
  `impression` bigint(20) NOT NULL DEFAULT '0' COMMENT '计划展示次数；仅针对cpm计费；',
  `budget` bigint(20) NOT NULL DEFAULT '0' COMMENT '总预算，单位：1/1000分；',
  `actual_impression` bigint(20) NOT NULL DEFAULT '0' COMMENT '实际展示次数；仅针对cpm计费；',
