--
-- Table structure for table `ad_resource`
--

DROP TABLE IF EXISTS `ad_resource`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ad_resource` (
  `resource_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '记录ID，主键，自增；',
  `resource_name` varchar(48) COLLATE utf8_bin NOT NULL COMMENT '资源包名称',
  `resource_state` varchar(24) COLLATE utf8_bin NOT NULL COMMENT '资源包状态：nenquiry 询量中nerror 询量失败nvalid 有效nlocked 已锁定ninvalid 无效',
  `scene_type` int(11) NOT NULL DEFAULT '0' COMMENT '场景类型：\n1 地铁\n2 自动售货机\n101 智能电视\n201 DuerOS电视场景\r\n202 冰箱场景\r\n203 人脸识别场景\r\n',
  `traffic_type` int(11) NOT NULL COMMENT '流量类型：n1 开机n2 关机n3 屏保n4 APPn5 Launchern6 地铁',
  `position_type` int(11) NOT NULL COMMENT '广告位类型：n不同的流量类型对应的广告位不同，与流量类型映射；可以多选，多个广告位类型按位存放：n开机，app流量：n1 开屏；nApp流量：n2 前贴；n4 中贴；n8 后贴；n16 暂停贴；n32 插屏；n',
  `bid` bigint(20) NOT NULL DEFAULT '0' COMMENT '出价，单位：分；',
  `budget` bigint(20) NOT NULL DEFAULT '0' COMMENT '总预算，单位：分；',
  `impression` bigint(20) NOT NULL DEFAULT '0' COMMENT '预定总展示次数；',
  `start_date` date NOT NULL DEFAULT '0000-00-00' COMMENT '资源包询量开始日期；',
  `end_date` date NOT NULL DEFAULT '0000-00-00' COMMENT '资源包询量结束日期；',
  `time_bit` varchar(56) COLLATE utf8_bin NOT NULL COMMENT '推广时段：n            公式：星期*小时n            0 未勾选；n            1 勾选；n            第一位从星期一开始；n            生成168位字符串后',
  `enquiry_date` date NOT NULL DEFAULT '0000-00-00' COMMENT '最近一次询量日期',
  `stock_state` tinyint(4) NOT NULL COMMENT '库存状态：n0 不足；n1 充足；',
  `stock_detail` text COLLATE utf8_bin NOT NULL COMMENT '库存状态详情，列举每天的库存状态；',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间；',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间；',
  `create_by` bigint(20) NOT NULL DEFAULT '0' COMMENT '创建用户ID',
  `update_by` bigint(20) NOT NULL DEFAULT '0' COMMENT '修改用户ID',
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '标记当前记录所属用户',
  `order_code` varchar(48) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '资源包关联的订单号，未关联默认为空字符串；',
  PRIMARY KEY (`resource_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='资源包';
/*!40101 SET character_set_client = @saved_cs_client */;

