DROP TABLE IF EXISTS `creative_platform_audit`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `creative_platform_audit` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键，自增ID',
  `platform_id` int(11) NOT NULL DEFAULT '0' COMMENT '第三方平台ID',
  `creative_id` int(11) NOT NULL DEFAULT '0' COMMENT '创意ID',
  `version` int(11) NOT NULL DEFAULT '0' COMMENT '创意版本号',
  `platform_creative_id` varchar(1024) NOT NULL DEFAULT '' COMMENT '创意在第三方的ID',
  `audit_status` varchar(10) NOT NULL DEFAULT 'notpush' COMMENT '审核结果',
  `audit_info` varchar(1024) NOT NULL DEFAULT '' COMMENT '审核说明，如果是拒绝则是拒绝原因',
  `push_time` datetime NOT NULL DEFAULT '1971-01-01 00:00:00' COMMENT '推送时间',
  `finish_time` datetime NOT NULL DEFAULT '1971-01-01 00:00:00' COMMENT '审核完成时间',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属用户ID',
  PRIMARY KEY (`id`),
  KEY `indx_creative_id` (`creative_id`),
  KEY `indx_platform_id` (`platform_id`)
) ENGINE=InnoDB AUTO_INCREMENT=356 DEFAULT CHARSET=utf8 COMMENT='创意外审状态';
