  `cost_milli` bigint(20) NOT NULL DEFAULT '0' COMMENT '操作耗时，单位:ms',
  `oper_date` date NOT NULL DEFAULT '1970-01-01' COMMENT '操作日期',
  PRIMARY KEY (`log_id`),
  KEY `idx_oper_date` (`oper_date`)
) ENGINE=InnoDB AUTO_INCREMENT=1264 DEFAULT CHARSET=utf8 COMMENT='业务端操作日志表；';
